import{_ as e,p as o,q as d,a1 as l}from"./framework-d81ad7e5.js";const c={},i=l('<ul><li><p><strong>与 date 操作关系最大的就是两个转换函数：to_date (),to_char ()</strong></p></li><li><p><strong>to_date ()</strong> 作用将字符类型按一定格式转化为日期类型：</p><ul><li>具体用法:<code>to_date (&#39;&#39;2004-11-27&#39;&#39;,&#39;&#39;yyyy-mm-dd&#39;&#39;)</code>, 前者为字符串，后者为转换日期格式，注意，前后两者要以一对应。 如；<code>to_date (&#39;&#39;2004-11-27 13:34:43&#39;&#39;, &#39;&#39;yyyy-mm-dd hh24:mi:ss&#39;&#39;)</code> 将得到具体的时间</li></ul></li></ul><h4 id="多种日期格式" tabindex="-1"><a class="header-anchor" href="#多种日期格式" aria-hidden="true">#</a> 多种日期格式：</h4><ul><li><code>YYYY：</code>四位表示的年份</li><li><code>YYY，YY，Y：</code>年份的最后三位、两位或一位，缺省为当前世纪</li><li><code>MM：</code>01~12 的月份编号</li><li><code>MONTH：</code>九个字符表示的月份，右边用空格填补</li><li><code>MON：</code>三位字符的月份缩写</li><li><code>WW：</code>一年中的星期</li><li><code>D：</code>星期中的第几天</li><li><code>DD：</code>月份中的第几天</li><li><code>DDD：</code>年所中的第几天</li><li><code>DAY：</code>九个字符表示的天的全称，右边用空格补齐</li><li><code>HH，HH12：</code>一天中的第几个小时，12 进制表示法</li><li><code>HH24：</code>一天中的第几个小时，取值为 00~23</li><li><code>MI：</code>一小时中的分钟</li><li><code>SS：</code>一分钟中的秒</li><li><code>SSSS：</code>从午夜开始过去的秒数</li></ul><ul><li><strong>to_char ()</strong> : 将日期转按一定格式换成字符类型</li></ul><blockquote><p><code>select to_char(sysdate,&#39;&#39;yyyy-mm-dd hh24:mi:ss&#39;&#39;) time from dual;</code></p></blockquote><ul><li>即把当前时间按 yyyy-mm-dd hh24:mi:ss 格式转换成字符类型</li></ul>',6),t=[i];function a(s,r){return o(),d("div",null,t)}const n=e(c,[["render",a],["__file","ora_date.html.vue"]]);export{n as default};
